define([
  'shared/util/TemplateUtil',
  'shared/models/BaseUserProfile'
], function (TemplateUtil, BaseUserProfile) {

  var AppGroupProfile = BaseUserProfile.Model.extend({

    url: function () {
      return TemplateUtil.tpl('/api/v1/apps/{{id}}/user/types/groups?expand=schema')(this);
    }

  });

  return {
    Model: AppGroupProfile
  };
});
